import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
// import NavDropdown from 'react-bootstrap/NavDropdown';
import 'bootstrap/dist/css/bootstrap.min.css';
import logo from './ramenLogo.gif';
import '../components/Header.css';

const Header = (props) =>{
  return (
    <Navbar  expand="md" className="myNav">
      <Container id="theHeader">
        <Navbar.Brand href="#home">
          <div className="logo-title">
               <img src={logo} className="header-logo d-inline-block align-top" alt="logo" />
               <h1 className="header-title">The Ramen Report</h1>
          </div>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto myLinks">
            <Nav.Link className="myLinks" href="#ratings">View Ratings</Nav.Link>
            <Nav.Link className="myLinks" href="#review">Make a Review</Nav.Link>
            <Nav.Link className="myLinks" href="#about">About</Nav.Link>
           {/* <NavDropdown title="Dropdown" id="basic-nav-dropdown">
